import React from 'react';

export const WhatToExpect = (props) => {
  const features = [
    {
      title: "Attractive Locations",
      description: "Our properties are strategically located in prime areas, offering convenience, accessibility, and a premium lifestyle with security.",
      icon: "üìç", // Placeholder for the icon, replace with actual icons
    },
    {
      title: "Dedicated Planning and Production Teams",
      description: "Our passionate and skilled team is dedicated to providing personalized service and ensuring your real estate journey is not stressful!",
      icon: "üë•",
    },
    {
      title: "Flexible and Modern Spaces",
      description: "We offer a wide range of flexible and contemporary spaces designed to cater to your unique needs and personal preferences.",
      icon: "üè¢",
    },
    {
      title: "Human-Centered and Spacious Design",
      description: "Our properties are thoughtfully crafted with a focus on human-centered design, creating spaces that inspire comfort and wellbeing.",
      icon: "üè°",
      extraClass: 'lower-section' // Add a unique class for this section
    },
    {
      title: "Innovative Amenities",
      description: "Enjoy a host of modern amenities that will improve your lifestyle, from smart technology to premium entertainment options.",
      icon: "üí°",
    },
    {
      title: "Proven Track Record",
      description: "With a successful portfolio of completed projects, you can trust in our proven track record of delivering excellence every single time.",
      icon: "üìà",
    },
  ];

  return (
    <div className="whattoexpect">
      <div className="container">
        <div className="section-title text-center">
          <h2>What To Expect</h2>
        </div>
        <div className="row">
          {props}
         ? props.data.map((d, i) => (
          <div key={`${d.title}-${i}`} className="col-xs-6 col-md-3">
                  {" "}
                  <i className={d.icon}></i>
                  <h3>{d.title}</h3>
                  <p>{d.text}</p>
                </div>
              ))
            : "Loading..."}
        </div>
      </div>
    </div>
  );
};


export default WhatToExpect;
